import react from 'react';
import {variables} from './Variables.js';
export class Report extends Component{
    constructor(props){
      super(props);
      this.state={
        reports:[]
      }
    }
    refreshList(){
      fetch(variables.API_REPORT_URL+'report').then(response=>response.json()).then(data=>{
        this.setState({reports:data});
      });
    }
    componentDidMount(){
      this.refreshList();
    }

    render(){
    return (
      <div>
        <table className='table table-striped'>
          <thead>
          <tr>
            <th>
              ReportId
            </th>
          </tr>
          </thead>
          <tbody>
            {reports.map(report=>
              <tr key={report.RepordId}>
                <td>{report.RepordId}</td>
                <td>{report.ReportId}</td>
              </tr>)}
          </tbody>
        </table>
      </div>
    )
  }
}
